This sample shows how to call HeadNoParamsAsync with required parameters and parse the result.

var credential = new AzureKeyCredential("<key>");
var client = new ParamsClient(credential);

Response response = await client.HeadNoParamsAsync("<newParameter>", new RequestContext()).ConfigureAwait(false);

JsonElement result = JsonDocument.Parse(response.ContentStream).RootElement;
Console.WriteLine(result.ToString());

